import './dashboard.css'
import { Card,Button} from 'react-bootstrap';
function Dashboard()
{
    return (
   <div className='dashboardContainer'>
    <div>
        <Card className='dashboardCard'>
             <Card.Body>


                    <Card.Title>Card Title</Card.Title>
                   
                </Card.Body>
        </Card>
    </div>
   </div>
    );
}

export default Dashboard;
